import React, { useEffect, useState } from "react";
import Select from "react-select";
import US_STATES from "../data/us_states"; // array [{value:"NY", label:"New York"}, ...]

const DOMAIN_OPTIONS = [
  { value: "Data Science", label: "Data Science" },
  { value: "AI", label: "AI" },
  { value: "Web Dev", label: "Web Dev" },
];

const ROLE_OPTIONS = {
  "Data Science": [
    { value: "Data Analyst", label: "Data Analyst" },
    { value: "Data Scientist", label: "Data Scientist" },
  ],
  AI: [
    { value: "ML Engineer", label: "ML Engineer" },
    { value: "AI Researcher", label: "AI Researcher" },
  ],
  "Web Dev": [
    { value: "Frontend Dev", label: "Frontend Dev" },
    { value: "Backend Dev", label: "Backend Dev" },
  ],
};

const WORK_MODES = [
  { value: "remote", label: "Remote" },
  { value: "hybrid", label: "Hybrid" },
  { value: "onsite", label: "Onsite" },
];

const VISA_OPTIONS = [
  { value: "yes", label: "Yes" },
  { value: "no", label: "No" },
  { value: "future", label: "Yes in future" },
];

export default function ProfileForm({ token }) {
  const [yoe, setYoe] = useState(1);
  const [domains, setDomains] = useState([]);
  const [roles, setRoles] = useState([]);
  const [workModes, setWorkModes] = useState([]);
  const [location, setLocation] = useState(null);
  const [visa, setVisa] = useState(null);

  // Load profile
  useEffect(() => {
    if (!token) return;
    fetch("http://localhost:8000/api/profile/me", {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then(res => (res.ok ? res.json() : null))
      .then(data => {
        if (!data) return;
        setYoe(data.years_experience || 1);
        setDomains(
          (data.domain ? [data.domain] : []).map(d => ({ value: d, label: d }))
        );
        const domainRoles = (data.domain ? ROLE_OPTIONS[data.domain] : []) || [];
        setRoles(
          (data.other ? [data.other] : []).map(r => domainRoles.find(dr => dr.value === r) || { value: r, label: r })
        );
        setWorkModes(
          data.work_mode ? [{ value: data.work_mode, label: data.work_mode }] : []
        );
        setLocation(data.location ? { value: data.location, label: data.location } : null);
        setVisa(data.visa_required ? { value: data.visa_required, label: data.visa_required } : null);
      });
  }, [token]);

  const handleDomainChange = selected => {
    setDomains(selected);
    // reset roles based on selected domain
    if (selected.length > 0) {
      const domain = selected[0].value;
      setRoles(ROLE_OPTIONS[domain] || []);
    } else {
      setRoles([]);
    }
  };

  const handleSubmit = async e => {
    e.preventDefault();
    if (!token) return alert("Not logged in");

    const body = {
      years_experience: yoe,
      domain: domains.length ? domains[0].value : null,
      work_mode: workModes.length ? workModes[0].value : null,
      location: location ? location.value : null,
      visa_required: visa ? visa.value : null,
      other: roles.length ? roles.map(r => r.value).join(",") : "",
    };

    const res = await fetch("http://localhost:8000/api/profile/me", {
      method: "POST",
      headers: { "Content-Type": "application/json", Authorization: `Bearer ${token}` },
      body: JSON.stringify(body),
    });

    if (res.ok) alert("Saved");
    else alert("Save failed");
  };

  return (
    <form onSubmit={handleSubmit} style={{ maxWidth: 600 }}>
      <h3>Profile</h3>

      <label>Years of Experience</label>
      <input type="number" value={yoe} onChange={e => setYoe(Number(e.target.value))} />

      <label>Domain</label>
      <Select options={DOMAIN_OPTIONS} value={domains} onChange={handleDomainChange} />

      <label>Job Roles</label>
      <Select options={roles} value={roles} onChange={setRoles} isMulti />

      <label>Work Preference</label>
      <Select options={WORK_MODES} value={workModes} onChange={setWorkModes} isMulti />

      <label>Location</label>
      <Select options={[...US_STATES, { value: "Anywhere in US", label: "Anywhere in US" }]} value={location} onChange={setLocation} />

      <label>Visa Sponsorship</label>
      <Select options={VISA_OPTIONS} value={visa} onChange={setVisa} />

      <button type="submit">Save</button>
    </form>
  );
}
